import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { trigger, transition, style, animate, query, stagger } from '@angular/animations';

export const signUpAnimation = [
  trigger('signUpAnimation', [
    transition(':enter', [
      query('.login-card', [
        style({ opacity: 0, transform: 'translateY(30px)' }),
        animate('500ms 300ms ease-out', style({ opacity: 1, transform: 'translateY(0)' }))
      ]),
      query('h2, p', [
        style({ opacity: 0, transform: 'translateY(20px)' }),
        stagger(100, [
          animate('400ms 500ms ease-out', style({ opacity: 1, transform: 'none' }))
        ])
      ]),
      query('.form-group', [
        style({ opacity: 0, transform: 'translateX(-20px)' }),
        stagger(100, [
          animate('400ms 700ms ease-out', style({ opacity: 1, transform: 'none' }))
        ])
      ]),
      query('.login-footer', [
        style({ opacity: 0 }),
        animate('400ms 1000ms ease-out', style({ opacity: 1 }))
      ])
    ])
  ])
];

@Component({
  selector: 'app-sign-up',
  templateUrl: './sign-up.component.html',
  styleUrls: ['./sign-up.component.css'],
  animations: [signUpAnimation]
})
export class SignUpComponent implements OnInit {
  @HostBinding('@signUpAnimation') animate = true;
  companyName: string = '';
  password: string = '';
  confirmPassword: string = '';
  showErrors: boolean = false;
  passwordVisible: boolean = false;
  confirmPasswordVisible: boolean = false;

  constructor(private router: Router) {}

  ngOnInit() {
    // Add any initialization logic here
  }

  togglePasswordVisibility(): void {
    this.passwordVisible = !this.passwordVisible;
  }

  toggleConfirmPasswordVisibility(): void {
    this.confirmPasswordVisible = !this.confirmPasswordVisible;
  }

  onSubmit() {
    this.showErrors = true;

    if (!this.companyName || this.password.length < 8 || this.password !== this.confirmPassword) {
      return;
    }

    // Proceed with submission logic
  }
  navigateToLogin(){
    this.router.navigate(['/login']);
  }
}
